close all
clc
%[text] Speed and Torque Inputs
W = linspace(1,1000);
T = linspace(1,250);
[W,T] = meshgrid(W,T);
%[text] Constants
Kc = 0.2;
Ki = 0.008;
Kw = 0.00001;
C = 20;
%[text] Calculating the loss
Cl = Kc*(T.^2);
Il = Ki*W;
Wl = Kw*(W.^3);
%[text] Total Loss of the motor
Tl = Cl + Il + Wl + C;
%[text] Calculating Power
P_out = W.*T;
P_in = P_out + Tl;
%[text] Efficiency
Z = P_out./P_in;
V = [0.70,0.75,0.80,0.85,0.90,0.91,0.92,0.93];
%[text] Plotting
contourf(W,T,Z,V) %[output:4e8579b9]
colorbar %[output:4e8579b9]
box off %[output:4e8579b9]
grid on %[output:4e8579b9]
title('Contour Plot of Motor'); %[output:4e8579b9]
xlabel('Speed in rad/s'); %[output:4e8579b9]
ylabel('Torque in Nm'); %[output:4e8579b9]
